Wyłączna strefa ekonomiczna – obszar rozciągający się poza morzem terytorialnym do 200 mil morskich (370 km) mierzonych od linii podstawowej. Na tym obszarze państwo nadbrzeżne posiada wyłączne prawa suwerenne do: 
* badania i eksploatacji, ochrony i gospodarowania zasobami naturalnymi, zarówno żywymi, jak i nieożywionymi dna morza, jego podziemia oraz pokrywających je wód; 
* wznoszenia i użytkowania sztucznych wysp, instalacji i konstrukcji; 
* badań naukowych morza; 
* ochrony i zachowania środowiska morskiego. Poza wymienionymi wyłącznymi prawami państwa nadbrzeżnego wszystkie państwa na jednakowych zasadach korzystają z wolności morza pełnego, w tym z wolności żeglugi, przelotu, układania kabli i rurociągów. Instytucja wyłącznej strefy ekonomicznej została uregulowana w Konwencji o prawie morza z 1982 r. podpisanej w Montego Bay na Jamajce (część V, art. 55-75). Wszystkie państwa nadbrzeżne, z wyjątkiem kilku, które geograficznie nie mają możliwości lub utrzymują starszą instytucję – strefę wyłącznego rybołówstwa, ustanowiło strefy ekonomiczne (w tym Stany Zjednoczone w 1983 roku i ZSRR w 1984 roku).
